CREATE DATABASE  IF NOT EXISTS `testeindex2`;
USE `testeindex2`;


CREATE TABLE `fone` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ddd` int(3) NOT NULL,
  `numero` int(8) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20312 DEFAULT CHARSET=utf8;


CREATE TABLE `fone_indexado` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ddd` int(3) NOT NULL,
  `numero` int(8) NOT NULL,
  PRIMARY KEY (`id`),
  INDEX (`numero`)
) ENGINE=InnoDB AUTO_INCREMENT=20309 DEFAULT CHARSET=utf8;


CREATE TABLE `cidade` (
  `id` int(11) NOT NULL ,
  `ddd` int(3) ,
  `nome` varchar(45) NOT NULL,
  `estado` varchar(30) NOT NULL,
  `populacao` int(10) 
) ENGINE=InnoDB AUTO_INCREMENT=20309 DEFAULT CHARSET=utf8;


DELIMITER $$
DROP PROCEDURE IF EXISTS modifica$$
CREATE PROCEDURE modifica()
BEGIN
DECLARE cod_ddd  INT;
DECLARE pop  INT;
DECLARE elemento  INT;
 
SET cod_ddd = 0;
 
WHILE (cod_ddd <= 1000) DO
SET pop = ((RAND()*1000)*(RAND()*1000)*(RAND()*100));
SET elemento = (SELECT id FROM cidade LIMIT cod_ddd,1);
UPDATE cidade set ddd=(cod_ddd+1), populacao=pop where id=elemento;
SET  cod_ddd = cod_ddd + 1; 
END WHILE;

END$$
DELIMITER ;

-- INSERIR OS ELEMENTOS NA TABELA CIDADE


-- CREATE INDEX idx_numero ON agenda_indexada(numero);


CALL modifica();
-- MODIFICAR AS TABELAS FONE E FONE_INDEX E INSERIR SEUS ELEMENTOS.
-- RENAME TABLE agenda TO fone;
-- RENAME TABLE agenda_indexada TO fone_indexado;
ALTER TABLE cidade ADD PRIMARY KEY (ddd);
ALTER TABLE fone ADD CONSTRAINT `fk_DDD` FOREIGN KEY ( `ddd` ) REFERENCES `cidade` ( `ddd` );
ALTER TABLE fone_indexado ADD CONSTRAINT `fk_DDdD` FOREIGN KEY ( `ddd` ) REFERENCES `cidade` ( `ddd` );
